import React from 'react';

const todo = () => {
	return (
		<>
			<div className="box_todo">
				<div className="todo_add_delete">
					<p>Helloheheheh</p>
				</div>
				<button className="confirmed"></button>
				<button className="deleted"></button>
			</div>
		</>
	);
};

export default todo;
